import{_ as t,c as s,o as a,ag as i}from"./chunks/framework.Ds6Eueu6.js";const u=JSON.parse('{"title":"gpdeletesystem","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/utility_guide/ref/gpdeletesystem.md","filePath":"docs/7x/utility_guide/ref/gpdeletesystem.md"}'),o={name:"docs/7x/utility_guide/ref/gpdeletesystem.md"};function n(l,e,p,d,r,c){return a(),s("div",null,e[0]||(e[0]=[i(`<h1 id="gpdeletesystem" tabindex="-1">gpdeletesystem <a class="header-anchor" href="#gpdeletesystem" aria-label="Permalink to &quot;gpdeletesystem&quot;">​</a></h1><p>Deletes a WarehousePG cluster that was initialized using <code>gpinitsystem</code>.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>gpdeletesystem [-d &lt;coordinator_data_directory&gt;] [-B &lt;parallel_processes&gt;] </span></span>
<span class="line"><span>   [-f] [-l &lt;logfile_directory&gt;] [-D]</span></span>
<span class="line"><span></span></span>
<span class="line"><span>gpdeletesystem -? </span></span>
<span class="line"><span></span></span>
<span class="line"><span>gpdeletesystem -v</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p>The <code>gpdeletesystem</code> utility performs the following actions:</p><ul><li>Stop all <code>postgres</code> processes (the segment instances and coordinator instance).</li><li>Deletes all data directories.</li></ul><p>Before running <code>gpdeletesystem</code>:</p><ul><li>Move any backup files out of the coordinator and segment data directories.</li><li>Make sure that WarehousePG is running.</li><li>If you are currently in a segment data directory, change directory to another location. The utility fails with an error when run from within a segment data directory.</li></ul><p>This utility will not uninstall the WarehousePG software.</p><h2 id="options" tabindex="-1"><a id="section4"></a>Options <a class="header-anchor" href="#options" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Options&quot;">​</a></h2><p>-d coordinator_data_directory : Specifies the coordinator host data directory. If this option is not specified, the setting for the environment variable <code>COORDINATOR_DATA_DIRECTORY</code> is used. If this option is specified, it overrides any setting of <code>COORDINATOR_DATA_DIRECTORY</code>. If coordinator_data_directory cannot be determined, the utility returns an error.</p><p>-B parallel_processes : The number of segments to delete in parallel. If not specified, the utility will start up to 60 parallel processes depending on how many segment instances it needs to delete.</p><p>-f (force) : Force a delete even if backup files are found in the data directories. The default is to not delete WarehousePG instances if backup files are present.</p><p>-l logfile_directory : The directory to write the log file. Defaults to <code>~/gpAdminLogs</code>.</p><p>-D (debug) : Sets logging level to debug.</p><p>-? (help) : Displays the online help.</p><p>-v (show utility version) : Displays the version, status, last updated date, and check sum of this utility.</p><h2 id="examples" tabindex="-1"><a id="section5"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>Delete a WarehousePG cluster:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>gpdeletesystem -d /gpdata/gp-1</span></span></code></pre></div><p>Delete a WarehousePG cluster even if backup files are present:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>gpdeletesystem -d /gpdata/gp-1 -f</span></span></code></pre></div><h2 id="see-also" tabindex="-1"><a id="seealso"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;seealso&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./gpinitsystem.html">gpinitsystem</a></p>`,25)]))}const g=t(o,[["render",n]]);export{u as __pageData,g as default};
